import React from 'react';
import '../App.css';
import { useNavigate, Navigate, Link } from 'react-router-dom';
import Grid from '@mui/material/Grid';
// import axios from 'axios';
import {
  Button,
  CssBaseline,
  TextField,
  Typography,
  Container,
} from '@mui/material';
import { styled } from '@mui/system';
import { createTheme, ThemeProvider } from '@mui/material/styles';

const defaultTheme = createTheme();
const Box = styled('div')({
  display: 'flex',
  width: '100%',
  border: '1px solid black',
})

function Experiences({ token, setTokenFunction }) {
  const navigate = useNavigate();

  // this should save the experience selected.
  const chooseExperience = async (e) => {
    e.preventDefault();
    try {
      navigate('/projects')
    } catch (err) {
      alert(err.response.data.error);
    }
  };

  return (
      <Container component="main" maxWidth="md" sx={{ padding: 0 }}>
        <Grid sx={{ flexGrow: 1, height: "100vh" }} container>
          <Grid item xs={4}>
            <Box>
              Premium
            </Box>
          </Grid>
          <Grid item xs={4}>
            <Box>
              Plus
            </Box>
          </Grid>
          <Grid item xs={4}>
            <Box>
              Base
            </Box>
          </Grid>
        </Grid>
      </Container>
  )
}

export default Experiences;
